import { InputLabel, TextField, Typography,Box } from "@mui/material";
import React, { useState } from "react";

const labStyles= {mb:1,mt:2,fontSize:"24px",fontWeight:"bold"}
const AddBlog =()=>
{
    const [inputs,setInputs] =useState({
        title:"", description:"" ,imageURL:"",
     });
    return (
        <div>
            <form>
                <Box border={3} 
                borderColor="green" 
                borderRadius={10} 
                boxShadow="10px 10px 20px #ccc" 
                padding={3} 
                margin={"auto"}
                marginTop={3} 
                display="flex" 
                flexDirection={"column"}
                 width={"50%"}>
                    <Typography fontWeight={"bold"} padding={3} variant="h4" color="grey" textAlign={"center"} >Post Your Blog</Typography>
                    <InputLabel sx={labStyles}>Title</InputLabel>
                    <TextField value={inputs.title} margin=" normal" variant="outlined"/>
                    <InputLabel sx={labStyles}>Description</InputLabel>
                    <TextField value={inputs.description} margin=" normal" variant="outlined"/>
                    <InputLabel sx={labStyles}>ImageUrl</InputLabel>
                    <TextField value={inputs.imageURL}margin=" normal" variant="outlined"/>
                </Box>
            </form>
        </div>
    )
}

export default AddBlog
